import java.util.ArrayList;
import java.util.List;
import java.util.Scanner;

public class Main {
	public static void main(String args[]) throws Exception {

		// 输入单词
		Scanner scanner = new Scanner(System.in);
		String word = scanner.nextLine();
		List<String> wordList = str2List(word);

		// 输入句子
		String sentence = scanner.nextLine();
		String[] array = sentence.split(" ");
		List<String> sentenceList = new ArrayList<String>();
		for (int i = 0; i < array.length; i++) {
			sentenceList.add(array[i]);
		}

		// 输出次数、位置
		fun(wordList, sentenceList, sentence);
	}

	public static void fun(List<String> wordList, List<String> sentenceList,
			String sentence) {

		int count = 0;
		int first = sentence.length();
		for (int i = 0; i < sentenceList.size(); i++) {
			List<String> doubtWordList = str2List(sentenceList.get(i));
			if (match(wordList, doubtWordList)) {
				count++;
				int location = 0;
				for (int j = 0; j < i; j++) {
					location += (sentenceList.get(j).length() + 1);
				}
				if (location < first) {
					first = location;
				}
			}
		}

		if (count > 0) {
			System.out.println(count + " " + first);
		} else {
			System.out.println("-1");
		}
	}

	public static boolean match(List<String> wordList,
			List<String> doubtWordList) {
		if (doubtWordList.size() != wordList.size()) {
			return false;
		}
		boolean match = true;
		for (int i = 0; i < wordList.size(); i++) {
			String wordU = wordList.get(i).toUpperCase();
			String wordL = wordList.get(i).toLowerCase();
			if (!doubtWordList.get(i).equals(wordU)
					&& !doubtWordList.get(i).equals(wordL)) {
				match = false;
				break;
			}
		}
		return match;
	}

	public static List<String> str2List(String str) {
		List<String> retList = new ArrayList<String>();
		if (str == null || str.length() == 0) {
			return retList;
		}
		for (int i = 0; i < str.length(); i++) {
			retList.add(str.substring(i, i + 1));
		}
		return retList;
	}
}

# coding=utf-8
def main():
    word, sentence = input().lower(), input().lower()

    pos = cnt = i = 0
    while i < len(sentence):
        if i == 0 or sentence[i-1] == ' ':
            j = 0
            while j < len(word) and word[j] == sentence[i]:
                i += 1
                j += 1
            if j == len(word) and (sentence[i] == ' ' or i == len(sentence)):
                if cnt == 0:
                    pos = i - len(word)
                cnt += 1
        i += 1

    if cnt > 0:
        print(' '.join([str(cnt), str(pos)]))
    else:
        print(-1)

if __name__ == '__main__':
    main()
